import type { ReactNode } from "react";
import { Link } from "react-router";
import { useState } from "react";
import CardSecondary from "~/componets/cardSecondary";

export default function GameShowcase() {
  let [currentCategorieIndex, setCategorieIndex] = useState(0);


  return (
    <section>
      <div className="flex justify-between items-center mb-4">
        <h3 className="font-epilogue text-2xl font-light  text-gray-100">
          Newest physical listings
        </h3>
        <Link to="/categories">
          <button className="px-1 bg-primary text-black text-bold rounded-lg font-bold cursor-pointer">
            Show All
          </button>
        </Link>
      </div>
      <div className="flex">
        {CategoriesLisitng.map(
          (category: { name: string; icon: ReactNode }, index: number) => (
            <div
              className={`flex items-center justify-center py-2.5 px-6 transition-all duration-300 cursor-pointer ${ currentCategorieIndex === index ? 'bg-gray-800' : ''}`}
              data-key={index}
              onClick={(event) => {
                const { key } = event.currentTarget.dataset;
                setCategorieIndex(Number(key));
              }}
            >
              {category.icon}
              <p className="ml-2">{category.name}</p>
            </div>
          )
        )}
      </div>
      <div className="flex bg-gray-800 space-x-15">
        {plataformListing.map(
          (plataform: { icon: ReactNode; items: number }, index: number) => (
            <div
              className="flex flex-col items-center justify-center py-2 pl-3.5 cursor-pointer"
              key={index}
            >
              {plataform.icon}
              <p className="mt-2">({plataform.items} items)</p>
            </div>
          )
        )}
      </div>
      <div className="flex w-full mt-7">
        <div className="flex-1">
          <img src="/img/gameshowcase-feature.png" alt="Feature image" />
        </div>
        <div className="flex-1 grid grid-cols-2 gap-4">
        {featuresGame.map((card) => (
          <CardSecondary src={card.src} alt={card.alt} name={card.name} edition={card.edition} prize={card.prize} discount={card.discount} plataforms={card.plataforms}></CardSecondary>
        ))}
        </div>
      </div>
    </section>
  );
}

